pm.test("Status code is 200", function () {
    pm.response.to.have.status(200);
});

pm.test("Body contains category with id 1 = dogs", function () {
    pm.expect(pm.response.text()).to.include("\"category\":{\"id\":1,\"name\":\"dogs\"}");
});

pm.test("Body contains name = Rufus", function () {
    pm.expect(pm.response.text()).to.include("\"name\":\"Rufus\"");
});

pm.test("Body contains tags with id 18 = medium and id 25 = short hair", function () {
    pm.expect(pm.response.text()).to.include("\"tags\":[{\"id\":18,\"name\":\"medium\"},{\"id\":25,\"name\":\"short hair\"}]");
});
